update Groupe
Set ParentCode = Division.Code
from NAF as Groupe
    join NAF as Division on left(Groupe.Code,2) = right('00' + Division.Code,2)
where groupe.levelname = 'Groupe'
and division.levelname = 'Division'
Go
    
update Classe
Set ParentCode = Groupe.Code
from NAF as Classe
    join NAF as Groupe on left(Classe.Code,4) = Groupe.Code
where Classe.levelname = 'Classe'
and Groupe.levelname = 'Groupe'
Go

update SousClasse
Set ParentCode = Classe.Code
from NAF as SousClasse
    join NAF as Classe on left(SousClasse.Code,5) = Classe.Code
where SousClasse.levelname = 'SousClasse'
and Classe.levelname = 'Classe'
Go

    
